import React from 'react';
import DictionaryAPI from './components/DictionaryAPI';
import Quiz from './components/Quiz';
import MyWords from './components/MyWords';
import { Switch, Route, Link } from 'react-router-dom';

var listOfWords = [
  {
    word : "hi",
    meaning : "hello"
  },
  {
    word : "ok",
    meaning : "bye"
  },
  {
    word : "something",
    meaning : "nothing"
  }
]


function Navbar(){
  return (
    <div>
      <Link to="/">MyWords</Link>
      <Link to="/quiz">Quiz</Link>
      <Link to="/search">ssearch</Link>
    </div>
  );
}

class App extends React.Component{
  state = {
    word : "hello lifted state"
  }
  render(){
    return (
      <div>
        <Navbar />
        <Switch>
          <Route 
            path='/' 
            exact 
            render={(props) => <MyWords words={listOfWords}/>}
          />  
          <Route 
            path='/quiz'
            component={Quiz}
          />
          <Route 
            path='/search' 
            component={DictionaryAPI}
          />
        </Switch>
      </div>
    );
  }
}



export default App;
